var title_f4_46_4835="Malignant gastric ulcer Endosc";
var content_f4_46_4835=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=GAST%2F58136&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=GAST%2F58136&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Malignant and benign gastric ulcer: Endoscopic appearance",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 353px; height: 486px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Endoscopy showing the differences between the endoscopic appearance of malignant and benign gastric ulcers.",
"    <br/>",
"    (A) Retroflexed views were required on endoscopy to detect this malignant gastric ulcer of the cardia. Note the absence of folds radiating to the base and the exophytic appearance. Biopsies confirmed the presence of adenocarcinoma.",
"    <br/>",
"    (B) Benign gastric ulcer in the prepyloric region. The ulcer is well-circumscribed with folds radiating to the ulcer base.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Paul C Schroy III, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
