var title_f4_46_4844="RTOG LENT criteria";
var content_f4_46_4844=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ONC%2F53812&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ONC%2F53812&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Radiation therapy oncology group (RTOG) criteria for long-term normal tissue toxicity",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Symptoms",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Diarrhea",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Frequent loose bowel movements without associated rectal irritation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Proctitis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Rectal irritation or urgency, and the presence of mucous or",
"blood in the stool, with or without frequent or sometimes loose bowel",
"movements",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Cystitis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Irritative bladder symptoms such as frequent dysuria; hematuria may or may not be a part of the clinical picture",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Grades",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Grade 0",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        No symptoms",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Grade 1",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Minor symptoms requiring no treatment",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Grade 2",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Symptoms that respond to simple outpatient management, and do not affect lifestyle",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Grade 3",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Distressing",
"symptoms affecting lifestyle; may necessitate hospital admission or",
"minor surgical intervention (eg, urethral dilation)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Grade 4",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Major surgical intervention or long stay in the hospital necessary (eg, laparotomy, colostomy, or cystectomy)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Grade 5",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Fatal complications",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from Rubin P. Int J Radiat Oncol Biol Phys 1995; 31:1035.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
